import React from 'react';

const ClinicCard = ({clinic,editClinic, deleteClinicMethod}) => {
    return (
        <div className={"clinic-card-wrapper"}>
            <h2 className={"clinic-id"}>{clinic.id}</h2>
            <h2 className={"clinic-name"}>{clinic.clinicName}</h2>

         <div className={"clinic-card-btns"}>
             <button className="btn-secondary"
                     onClick={() => editClinic(clinic.id)}>edit
             </button>

             <button className="btn-danger"
                     onClick={() => deleteClinicMethod(clinic.id)}>delete
             </button>
         </div>
        </div>
    );
};

export default ClinicCard;
